import React from "react";
import Item from "./Item.js"

function MainContent(){

    const styles={
        backgroundColor: "white",
        padding: "50px",
        margin: "auto",
        width: "40%",
        cornerRadius: "5px",
        border: "1px solid black"
    }

    return(
        <div style={styles}>
            <Item />
            <Item />
            <Item />
            <Item />
        </div>
    );
}

export default MainContent;
